import { useState } from "react";
import "./clientDetail.css";

const ClientDetailPage = () => {
  const [client, setClient] = useState({
    name: "John Doe",
    phone: "9876543210",
    notes: "Prefers evening appointments",
  });

  const [services, setServices] = useState([]);
  const [currentService, setCurrentService] = useState("");
  const [price, setPrice] = useState("");

  const totalAmount = services.reduce((sum, s) => sum + s.price, 0);

  const addService = () => {
    if (!currentService || !price) return;

    setServices([
      ...services,
      { name: currentService, price: Number(price) },
    ]);
    setCurrentService("");
    setPrice("");
  };

  return (
    <div className="client-detail-page">
      {/* LEFT */}
      <div className="left-section">
        <div className="card">
          <h3>Client Details</h3>
          <input
            value={client.name}
            onChange={(e) => setClient({ ...client, name: e.target.value })}
            placeholder="Name"
          />
          <input
            value={client.phone}
            onChange={(e) => setClient({ ...client, phone: e.target.value })}
            placeholder="Phone"
          />
          <textarea
            value={client.notes}
            onChange={(e) => setClient({ ...client, notes: e.target.value })}
            placeholder="Notes"
          />
        </div>

        <div className="card">
          <h3>Add Visit</h3>

          <div className="service-row">
            <input
              value={currentService}
              onChange={(e) => setCurrentService(e.target.value)}
              placeholder="Service name"
            />
            <input
              type="number"
              value={price}
              onChange={(e) => setPrice(e.target.value)}
              placeholder="Price"
            />
            <button onClick={addService}>Add</button>
          </div>

          <div className="preview">
            {services.map((s, i) => (
              <div key={i} className="preview-item">
                <span>{s.name}</span>
                <span>₹{s.price}</span>
              </div>
            ))}
            <div className="total">Total: ₹{totalAmount}</div>
          </div>
        </div>
      </div>

      {/* RIGHT */}
      <div className="right-section">
        <div className="card">
          <h3>Last Visit</h3>
          <p><strong>Date:</strong> 12 Feb 2025</p>
          <p><strong>Services:</strong> Haircut, Beard</p>
          <p><strong>Total:</strong> ₹500</p>
        </div>

        <div className="card history">
          <h3>Visit History</h3>
          <div className="history-list">
            {[1, 2, 3, 4, 5].map((v) => (
              <div key={v} className="history-item">
                <span>10 Jan 2025</span>
                <span>₹400</span>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ClientDetailPage;
